import { Component } from 'react';
import React from 'react';
import {Tab, Tabs, Row} from 'react-bootstrap';
import Button from 'react-bootstrap/Button';

export default class GetEther extends Component {
    handleNextTab = () => {
        this.state.activeTab=((this.state.activeTab + 1) % 3);
    };
  constructor(props) {
    super(props);
    this.state = {activeTab: 0};
  }
  render(){
  return (
    <>
      <Tabs defaultTab={selectedTab.toString()}>
        <TabList>
          <Tab tabFor="0">Tab 1</Tab>
          <Tab tabFor="1">Tab 2</Tab>
          <Tab tabFor="2">Tab 3</Tab>
        </TabList>
        <TabPanel tabId="0">
          <p>Tab 1 content</p>
        </TabPanel>
        <TabPanel tabId="1">
          <p>Tab 2 content</p>
        </TabPanel>
        <TabPanel tabId="2">
          <p>Tab 3 content</p>
        </TabPanel>
      </Tabs>
      <Button onClick={() => setSelectedTab((selectedTab + tabCount - 1) % tabCount )}>Back</Button>
      <Button onClick={() => setSelectedTab((selectedTab + 1) % tabCount )}>Next</Button>
    </>
  );
}
}
